// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Migrations {
    uint256 public last_completed_migration;

    mapping(address => bool) public owners;

    constructor() {
        // set contract deployer as owner
        owners[msg.sender] = true;
    }

    modifier restricted() {
        require(
            owners[msg.sender],
            "This function is restricted to a contract owner"
        );
        _;
    }

    function setCompleted(uint256 completed) public restricted {
        last_completed_migration = completed;
    }

    function setOwner(address owner) public restricted {
        owners[owner] = true;
    }

    function removeOwner(address owner) public restricted {
        // This ensures that atleast one owner always exists
        require(
            owner != msg.sender,
            "ERR_MSG_SENDER_CAN_ONLY_REMOVE_OTHER_OWNERS"
        );
        owners[owner] = false;
    }
}
